import { Navigate, NavLink, Outlet } from "react-router-dom";
import logo from "../../logos/branditLogo.png"
import sun from "../../logos/Sun.png"
import vector from "../../logos/Vector.png"
import "./Layout.css";
export const Layout = () => {
    const activeStyle = {
        fontWeight: 700
    }
    return (
        <>
            <div className="navbarWrapper">
                <img src={logo} className="logo" onClick={() => {
                    <Navigate/>
                }}/>
                <div className="links">
                    <NavLink to="/Portfolio" className={({isActive}) => 
                        isActive ? "portfolioBold" : "portfolio"
                    }>Portfolio</NavLink>
                    <NavLink to="/About" className={({isActive}) => 
                        isActive ? "aboutBold" : "about"
                    }>About</NavLink>
                    <NavLink to="/Services" className={({isActive}) => 
                        isActive ? "serviceBold" : "service"
                    }>Service</NavLink>
                    <NavLink to="/ContactUs" className={({isActive}) => 
                        isActive ? "contactUsBold" : "contactUs"
                    }>ContactUs</NavLink>
                </div>
                <div className="sunWrapper">
                    <img src={sun} className="sun"/>
                    <div className="enWrapper">
                        <h1 className="en">En</h1>
                        <img src={vector} className="vector"/>
                    </div>
                </div>
            </div>
            <Outlet/>
        </>
    )
}
